INSERT INTO `ext_translations` VALUES (1,'en','Proethos2\\ModelBundle\\Entity\\Help','message','1','Brief summary of the protocol'),(2,'en','Proethos2\\ModelBundle\\Entity\\Help','message','2','Key words pertaining to the protocol, separated by commas'),(3,'en','Proethos2\\ModelBundle\\Entity\\Help','message','3','Introductory information of the protocol'),(4,'en','Proethos2\\ModelBundle\\Entity\\Help','message','4','Justification of the study'),(5,'en','Proethos2\\ModelBundle\\Entity\\Help','message','5','Objectives of the study'),(6,'en','Proethos2\\ModelBundle\\Entity\\Help','message','13','Is this submission a clinical trial?'),(7,'en','Proethos2\\ModelBundle\\Entity\\Help','message','14','Scientific title of the protocol'),(8,'en','Proethos2\\ModelBundle\\Entity\\Help','message','15','Public title of protocol'),(9,'en','Proethos2\\ModelBundle\\Entity\\Help','message','16','Does this protocol have an acronym?'),(10,'en','Proethos2\\ModelBundle\\Entity\\Help','message','56','Search for a  user by name or email address'),(11,'en','Proethos2\\ModelBundle\\Entity\\Help','message','64','Search for a meeting by subject'),(12,'en','Proethos2\\ModelBundle\\Entity\\Help','message','65','Date'),(13,'en','Proethos2\\ModelBundle\\Entity\\Help','message','66','Subject'),(14,'en','Proethos2\\ModelBundle\\Entity\\Help','message','67','Content'),(15,'en','Proethos2\\ModelBundle\\Entity\\Help','message','70','Profile'),(16,'en','Proethos2\\ModelBundle\\Entity\\Help','message','72','Search for protocols by ID number, key word or investigator\'s name'),(17,'en','Proethos2\\ModelBundle\\Entity\\Help','message','73','Protocolo status'),(18,'en','Proethos2\\ModelBundle\\Entity\\Help','message','82','Search for protocols by ID number, key word, or investigator name'),(19,'en','Proethos2\\ModelBundle\\Entity\\Help','message','83','Protocol status'),(20,'en','Proethos2\\ModelBundle\\Entity\\Help','message','88','Search for a question by entering a key word'),(21,'en','Proethos2\\ModelBundle\\Entity\\Help','message','89','Question'),(22,'en','Proethos2\\ModelBundle\\Entity\\Help','message','90','Answer'),(23,'en','Proethos2\\ModelBundle\\Entity\\Help','message','91','Active?'),(24,'en','Proethos2\\ModelBundle\\Entity\\Help','message','92','Search for a document by title or by user role'),(25,'en','Proethos2\\ModelBundle\\Entity\\Help','message','93','Title'),(26,'en','Proethos2\\ModelBundle\\Entity\\Help','message','94','Description'),(27,'en','Proethos2\\ModelBundle\\Entity\\Help','message','96','File'),(28,'en','Proethos2\\ModelBundle\\Entity\\Help','message','97','Active?'),(29,'en','Proethos2\\ModelBundle\\Entity\\Help','message','112','Committee screening'),(30,'en','Proethos2\\ModelBundle\\Entity\\Help','message','122','# of evaluations required'),(31,'en','Proethos2\\ModelBundle\\Entity\\Help','message','123','Select meeting date'),(32,'en','Proethos2\\ModelBundle\\Entity\\Help','message','124','Communicate decision'),(33,'en','Proethos2\\ModelBundle\\Entity\\Help','message','125','Final decision'),(34,'en','Proethos2\\ModelBundle\\Entity\\Help','message','126','Message'),(35,'en','Proethos2\\ModelBundle\\Entity\\Help','message','127','Reject submission'),(36,'en','Proethos2\\ModelBundle\\Entity\\Help','message','128','Reason why protocol is being returned'),(37,'en','Proethos2\\ModelBundle\\Entity\\Help','message','129','Accept submission'),(38,'en','Proethos2\\ModelBundle\\Entity\\Help','message','183','Decision'),(39,'en','Proethos2\\ModelBundle\\Entity\\Help','message','184','Is this a confidential message?'),(40,'en','Proethos2\\ModelBundle\\Entity\\Help','message','185','Monitoring time frame'),(41,'en','Proethos2\\ModelBundle\\Entity\\Help','message','198','Submission Language'),(42,'en','Proethos2\\ModelBundle\\Entity\\Help','message','199','Does my project need ethics review?'),(43,'en','Proethos2\\ModelBundle\\Entity\\Help','message','201','Hello!\n\nA new monitoring action has been submitted.\n\nAccess the link below for more details.\n\nProtocol <b>%protocol_code%</b>: %protocol_url%\n\nRegards,\nCMHS-REAMS Team'),(44,'en','Proethos2\\ModelBundle\\Entity\\Help','message','202','Dear investigator,\n\nYour protocol was sent to ethics review.\nThe committee will now meet to review your protocol, and an official decision will be sent to you shortly.\n\nAccess the link below for more details:\n\n%protocol_url%\n\nRegards,\nCMHS-REAMS Team'),(45,'en','Proethos2\\ModelBundle\\Entity\\Help','message','203','Hello!\n\nYou have been registered in the ProEthos2 Platform.\n\nPlease access the link below and set your password:\n\n%reset_password_url%\n\nRegards,\nCMHS-REAMS Team'),(46,'en','Proethos2\\ModelBundle\\Entity\\Help','message','204','Hello!\n\nYour access has been validated in the ProEthos2 platform.\n\nAccess the link below:\n\n%home_url%\n\nRegards,\nCMHS-REAMS Team'),(47,'en','Proethos2\\ModelBundle\\Entity\\Help','message','205','Hello!\n\nA message was sent to Proethos2 administrator from plataform.\n\n<b>User</b>: %username% (%email%)\n<b>Subject</b>: %subject%\n<b>Message</b>:\n%message%\n\nRegards,\nCMHS-REAMS Team'),(48,'en','Proethos2\\ModelBundle\\Entity\\Help','message','206','Hello!\n\nYou asked for a new password in Proethos2 platform.\n\nPlease access the link below to change your password:\n\n%reset_password_url%\n\nRegards,\nCMHS-REAMS Team'),(49,'en','Proethos2\\ModelBundle\\Entity\\Help','message','207','Hello!\n\nYou have been registered in the ProEthos2 Platform.\nPlease wait until your access has been validated.\nWe will send you an email.\n\nRegards,\nCMHS-REAMS Team'),(50,'en','Proethos2\\ModelBundle\\Entity\\Help','message','208','Hello!\n\nThere is a new user registered in the Proethos2 platform.\n\nPlease check and authorize this access.\n\n%home_url%\n\nRegards,\nCMHS-REAMS Team'),(51,'en','Proethos2\\ModelBundle\\Entity\\Help','message','209','Hello!\n\nYour protocol was rejected.\n\nAccess the link below for more details.\n\n%protocol_url%\n\nRegards,\nCMHS-REAMS Team'),(52,'en','Proethos2\\ModelBundle\\Entity\\Help','message','210','Hello! A new protocol needs your analysis.\n\nAccess the link below for more details.\n\nProtocol <b>%protocol_code%</b>: %protocol_url%\n\nRegards,\nCMHS-REAMS Team'),(53,'en','Proethos2\\ModelBundle\\Entity\\Help','message','211','Hello!\n\nYour protocol was sent to review.\n\nAccess the link below.\n\nProtocol <b>%protocol_code%</b>: %protocol_url%\n\nRegards,\nCMHS-REAMS Team'),(54,'en','Proethos2\\ModelBundle\\Entity\\Help','message','212','Dear investigator,\n\nCMHS-REAMS Team conducted an initial review of your research proposal and determined it must pass through full ethics review before initiating the research.\nCMHS-REAMS Team meets on the second Tuesday of each month to review complete proposals.\nCMHS-REAMS Team observations are emailed to research teams shortly after each monthly meeting.\n\nInitial committee screening: %committee_screening%\n\nAccess the link below for more details.\n\nProtocol <b>%protocol_code%</b>: %protocol_url%\n\nRegards,\nCMHS-REAMS Team'),(55,'en','Proethos2\\ModelBundle\\Entity\\Help','message','213','Dear investigator,\n\nCMHS-REAMS Team conducted an initial review of your research proposal and determined it must pass through full ethics review before initiating the research.\nCMHS-REAMS Team meets on the second Tuesday of each month to review complete proposals.\nCMHS-REAMS Team Observations are emailed to research teams shortly after each monthly meeting.\n\nAccess the link below for more details.\n\nProtocol <b>%protocol_code%</b>: %protocol_url%\n\nRegards,\nCMHS-REAMS Team'),(56,'en','Proethos2\\ModelBundle\\Entity\\Help','message','214','Dear investigator,\n\nWe write to you in regards to your research proposal, which you recently submitted to CMHS-REAMS Team for ethics review.\nAttached you will find the official decision issued by the Committee for this proposal.\nThank you for your submission. We look forward to continue receiving your valuable contributions.\n\nAccess the link below for more details.\n\nProtocol <b>%protocol_code%</b>: %protocol_url%\n\nRegards,\nCMHS-REAMS Team'),(57,'en','Proethos2\\ModelBundle\\Entity\\Help','message','215','Dear Reviewer,\r\n\r\nWe are writing to inform you that you have been selected to participate in an ethical review of a research study entitled \"%protocol_title%\" submitted to our institution. Your expertise in the relevant field and experience with research ethics make you an ideal candidate for this task.\r\n\r\nBefore we can proceed with the ethical review process, we kindly ask that you complete a declaration of potential conflicts of interest. The declaration form can be accessed via the following link: %protocol_url%\r\n\r\nThank you for your cooperation.\r\n\r\nBest regards,\r\n\r\nCMHS REAMS'),(58,'en','Proethos2\\ModelBundle\\Entity\\Help','message','216','Dear investigator,\n\nWe write to you in regards to your research proposal, which you recently submitted to CMHS-REAMS Team for ethics review.\nAttached you will find the official decision issued by the Committee for this proposal.\nThank you for your submission. We look forward to continue receiving your valuable contributions.\n\nAccess the link below for more details.\n\nProtocol <b>%protocol_code%</b>: %protocol_url%\n\nRegards,\nCMHS-REAMS Team'),(59,'en','Proethos2\\ModelBundle\\Entity\\Help','message','217','Hello!\n\nA new monitoring action has been submitted.\n\nAccess the link below for more details.\n\nProtocol <b>%protocol_code%</b>: %protocol_url%\n\nRegards,\nCMHS-REAMS Team'),(60,'en','Proethos2\\ModelBundle\\Entity\\ClinicalTrialName','name','1','Australian New Zealand Clinical Trials Registry'),(61,'en','Proethos2\\ModelBundle\\Entity\\Gender','name','2','Male'),(62,'en','Proethos2\\ModelBundle\\Entity\\Gender','name','3','Female'),(63,'en','Proethos2\\ModelBundle\\Entity\\Gender','name','4','Both'),(64,'en','Proethos2\\ModelBundle\\Entity\\MonitoringAction','name','1','Submit an amendment'),(65,'en','Proethos2\\ModelBundle\\Entity\\MonitoringAction','name','2','Adverse event report'),(66,'en','Proethos2\\ModelBundle\\Entity\\MonitoringAction','name','3','Conclusion of study'),(67,'en','Proethos2\\ModelBundle\\Entity\\MonitoringAction','name','4','Follow-up report'),(68,'en','Proethos2\\ModelBundle\\Entity\\MonitoringAction','name','5','Discontinuation of study'),(69,'en','Proethos2\\ModelBundle\\Entity\\MonitoringAction','name','6','Submit other documents'),(70,'en','Proethos2\\ModelBundle\\Entity\\MonitoringAction','name','7','Request extension of approval'),(71,'en','Proethos2\\ModelBundle\\Entity\\MonitoringAction','name','8','Cancellation of study'),(72,'en','Proethos2\\ModelBundle\\Entity\\RecruitmentStatus','name','1','Recruiting'),(73,'en','Proethos2\\ModelBundle\\Entity\\RecruitmentStatus','name','2','Suspended'),(74,'en','Proethos2\\ModelBundle\\Entity\\RecruitmentStatus','name','3','Completed'),(75,'en','Proethos2\\ModelBundle\\Entity\\RecruitmentStatus','name','4','Other'),(76,'en','Proethos2\\ModelBundle\\Entity\\RecruitmentStatus','name','8','Pending'),(77,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','1','Protocol'),(78,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','2','Others'),(79,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','3','Decision'),(80,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','11','Institutional Authorization'),(81,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','27','Scientific Support'),(82,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','28','Bibliography'),(83,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','29','Questionnaire'),(84,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','30','Opinion'),(85,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','31','Decision issued by another committee'),(86,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','32','Survey'),(87,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','33','Justification waiver of consent'),(88,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','34','Recruitment material/participant information'),(89,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','35','Insurance policy'),(90,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','36','Estimation'),(91,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','37','Protocol with animals'),(92,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','38','Adverse event report'),(93,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','39','Executive Summary'),(94,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','40','Informed consent'),(95,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','41','Protocol'),(96,'en','Proethos2\\ModelBundle\\Entity\\UploadType','name','42','Opinion'),(97,'en','Proethos2\\ModelBundle\\Entity\\Faq','answer','1','<p>All research with human subjects should obtain ethics\napproval from a research ethics committee prior to its initiation. To meet the\ndefinition of research with human subjects, the proposal must constitute\nresearch and it must obtain information from human subjects. Research is\ndefined as any social science, biomedical, behavioral, or epidemiological\nactivity that entails systematic collection or analysis of data, with the\nintent to develop generalizable knowledge. Human subjects are defined as human\nbeings (i) who become individually identifiable through investigator?s\ncollection, preparation, or use of biological material or medical or other\nrecords, or (ii) who are exposed to manipulation, intervention, observation, or\nother interaction with investigators either directly or through alteration of\ntheir environment. Research with human subjects includes studies that use\ntissues, samples, data or records from humans, as well as studies that involve\nthe conduction of interviews, focus groups or surveys, or the observation of\nprivate behavior.</p>\n\n<p>Activities that do not constitute research with human\nsubjects are exempted from ethics review. These are activities that do not aim\nat the production of generalizable knowledge or do not involve human subjects\nin the ways described above. For example, the following activities do not\nconstitute research with human subjects and are thus exempted from ethics\nreview:</p>\n\n<ul><li>Studies using data that are publicly available or\ngenerated by observation of public behavior.</li></ul>\n\n<ul><li>Studies using data, samples, or tissue that already exist\n(i.e. the data, samples or tissue have been obtained by others) and are\nreceived by the research team in such a manner that the identity of the\nindividuals cannot be established.</li></ul>\n\n<ul><li>Public health activities conducted under recognized public\nhealth authority with the intent to prevent or control of disease or injury,\nincluding surveillance activities aimed only at the identification or control\nof a health problem. These are activities that seek the benefit of the\nparticipants or the participants? communities, and do not intend to generate\nknowledge that is applicable to other populations.</li></ul>\n\n<ul><li>Quality assurance activities or program evaluations aimed\nat improving the program at stake, and with no intent to produce generalizable\nknowledge.</li></ul>\n\n<p>Projects might involve multiple components, some of which\nmight constitute research with human subjects while other components might not.\nThe components that constitute research with human subjects should undergo\nethics review. Determinations about whether a proposal is exempted from ethics\nreview should be made by an independent party such as an ethics review\ncommittee.</p>'),(98,'en','Proethos2\\ModelBundle\\Entity\\Faq','question','1','What is subject to ethics review?'),(99,'en','Proethos2\\ModelBundle\\Entity\\Faq','question','2','What are the international ethical guidelines for research with human subjects?'),(100,'en','Proethos2\\ModelBundle\\Entity\\Faq','answer','2','<ul><li>Declaration of Helsinki of the World Medical Association\n(2013 revision): <a href=\"http://www.wma.net/en/30publications/10policies/b3/\" rel=\"nofollow\" target=\"_blank\">http://www.wma.net/en/30publications/10policies/b3/</a>\n</li></ul>\n\n<ul><li>International Ethical Guidelines for Biomedical Research\nInvolving Human Subjects of the Council for International Organizations of\nMedical Sciences (CIOMS): <a href=\"http://www.cioms.ch/publications/guidelines/guidelines_nov_2002_blurb.htm\" rel=\"nofollow\" target=\"_blank\">http://www.cioms.ch/publications/guidelines/guidelines_nov_2002_blurb.htm</a>\n</li></ul>\n\n<ul><li>International Guidelines for Ethical Review of\nEpidemiological Studies of the Council for International Organizations of\nMedical Sciences (CIOMS): <a href=\"http://www.cioms.ch/publications/guidelines/1991_texts_of_guidelines.htm\" rel=\"nofollow\" target=\"_blank\">http://www.cioms.ch/publications/guidelines/1991_texts_of_guidelines.htm</a>\n</li></ul>'),(101,'en','Proethos2\\ModelBundle\\Entity\\Faq','question','3','What are the standards of each country for research with human subjects?'),(102,'en','Proethos2\\ModelBundle\\Entity\\Faq','answer','3','<ul><li>International\nCompilation of Human Research Standards (2015 edition): <a href=\"http://www.hhs.gov/ohrp/international/index.html\" rel=\"nofollow\" target=\"_blank\">http://www.hhs.gov/ohrp/international/index.html</a>\n</li></ul>'),(103,'en','Proethos2\\ModelBundle\\Entity\\Faq','question','4','How should ethics review committees function?'),(104,'en','Proethos2\\ModelBundle\\Entity\\Faq','answer','4','<ul><li>Standards\nand Operational Guidance for Ethics Review of Health-Related Research with\nHuman Participants published by WHO: <a href=\"http://whqlibdoc.who.int/publications/2011/9789241502948_eng.pdf?ua=1\" rel=\"nofollow\" target=\"_blank\">http://whqlibdoc.who.int/publications/2011/9789241502948_eng.pdf?ua=1</a></li></ul>'),(105,'en','Proethos2\\ModelBundle\\Entity\\Faq','question','5','Which questions should guide the ethics review of research with human subjects?'),(106,'en','Proethos2\\ModelBundle\\Entity\\Faq','answer','5','<ul><li>Social value: Can the study lead to improvements in health\nor well-being? What is the potential value of the research for each of the\nprospective beneficiaries?</li></ul>\n\n<ul><li>Scientific validity: Is the investigation methodologically\nvalid and scientifically (and statistically) sound? Will the study generate\nvalid and reliable data that can be generalizable? Is the study feasible? Does\nthe study design ensure participants the health-care interventions they are\nentitled to? If not, are there methodologically compelling reasons and are\nparticipants protected from serious harm?</li></ul>\n\n<ul><li>Fair participant selection: What are the criteria to include\nand exclude participants? Is selection of participants based on scientific\ncriteria? Are research participants selected to minimize risks and maximize\npotential benefits? If participants are vulnerable, are there any safeguards to\nprotect them? Are the risks and potential benefits of the study fairly\ndistributed?</li></ul>\n\n<ul><li>Favorable risk-benefit ratio: Can the risks for participants\nbe minimized? Can potential benefits for individuals and society be improved?\nDo the potential benefits for society and individuals outweigh the risks?</li></ul>\n\n<ul><li>Informed consent: Is the information provided to potential\nparticipants accurate, clear, relevant and complete? Are the recruitment\nprocedures, consent process and incentives appropriate for their culture and\ncontext? Is there an appropriate plan for obtaining permission for those that\ncan?t consent for themselves? Are the participants being made aware of their\nright to refuse to participate and are they actually free to refuse?</li></ul>\n\n<ul><li>Respect for participants: How will the health and well-being\nof participants be monitored to minimize harms? How will their privacy be\nprotected? Can participants withdraw from the study without penalty? What are\nthe plans of care after the study is completed? Will participants be given any\nnew information (including the results of the study)?</li></ul>\n\n<p>(Adapted from (1) Emanuel E, Wendler D, Grady C. An ethical\nframework for biomedical research. In: Emanuel E et al. eds. The Oxford\ntextbook of clinical research ethics. New York, NY: Oxford University Press;\n2008: 123-135. (2) Emanuel E, Wendler D, Grady C. What makes clinical research\nethical? JAMA 2000;283:2701-27711. (3) Emanuel E, Wendler D, Killen J, Grady C.\nWhat makes clinical research in developing countries ethical? The benchmarks of\nethical research. JID 2004;189:930-937.)</p>\n\n<br><br><br><br>'),(107,'es_ES','Proethos2\\ModelBundle\\Entity\\Help','message','1','Resumen breve del protocolo'),(108,'es_ES','Proethos2\\ModelBundle\\Entity\\Help','message','2','Palabras claves referentes al protocolo, separadas por comas'),(109,'es_ES','Proethos2\\ModelBundle\\Entity\\Help','message','3','Información introductoria del protocolo'),(110,'es_ES','Proethos2\\ModelBundle\\Entity\\Help','message','4','Justificación del estudio'),(111,'es_ES','Proethos2\\ModelBundle\\Entity\\Help','message','5','Objetivos del estudio'),(112,'es_ES','Proethos2\\ModelBundle\\Entity\\Help','message','13','¿Es esta presentación un ensayo clínico?'),(113,'es_ES','Proethos2\\ModelBundle\\Entity\\Help','message','14','Título científico del protocolo'),(114,'es_ES','Proethos2\\ModelBundle\\Entity\\Help','message','15','Título público del protocolo'),(115,'es_ES','Proethos2\\ModelBundle\\Entity\\Help','message','16','¿Este protocolo tiene algún acronimo? ¿Siglas?'),(116,'es_ES','Proethos2\\ModelBundle\\Entity\\Help','message','56','Buscar un usuario por nombre o dirección de e-mail'),(117,'es_ES','Proethos2\\ModelBundle\\Entity\\Help','message','64','Buscar una reunión por tema'),(118,'es_ES','Proet