aprobación'),(599,'es_ES','Proethos2\\ModelBundle\\Entity\\MonitoringAction','name','8','Cancelación del estudio'),(600,'es_ES','Proethos2\\ModelBundle\\Entity\\RecruitmentStatus','name','1','Reclutando'),(601,'es_ES','Proethos2\\ModelBundle\\Entity\\RecruitmentStatus','name','2','Suspendido'),(602,'es_ES','Proethos2\\ModelBundle\\Entity\\RecruitmentStatus','name','3','Completado'),(603,'es_ES','Proethos2\\ModelBundle\\Entity\\RecruitmentStatus','name','4','Otro'),(604,'es_ES','Proethos2\\ModelBundle\\Entity\\RecruitmentStatus','name','8','Pendiente'),(605,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','1','Protocolo'),(606,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','2','Otros'),(607,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','3','Decisión'),(608,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','11','Autorización institucional'),(609,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','27','Apoyo científico'),(610,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','28','Bibliografía'),(611,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','29','Cuestionario'),(612,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','30','Opinión'),(613,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','31','Decisión emitida por otro comité'),(614,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','32','Encuesta'),(615,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','33','Justificación de dispensa del consentimiento'),(616,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','34','Material de reclutamiento/información del participante'),(617,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','35','Póliza de seguro'),(618,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','36','Estimación'),(619,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','37','Protocolo con animales'),(620,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','38','Reporte de evento adverso'),(621,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','39','Resumen ejecutivo'),(622,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','40','Consentimiento informado'),(623,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','41','Protocolo'),(624,'es_ES','Proethos2\\ModelBundle\\Entity\\UploadType','name','42','Opinión'),(625,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','question','1','¿Qué está sujeto a revisión ética?'),(626,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','answer','1','<p>Toda\ninvestigación con seres humanos debe obtener aprobación ética por parte de un\ncomité de revisión ética antes de iniciarse. Para constituir investigación con\nseres humanos la propuesta debe ser una investigación y debe obtener\ninformación de personas.</p>\n\n<p>La investigación\nse define como la actividad de ciencias sociales, biomédicas, del\ncomportamiento o epidemiológica que implica recabar o analizar datos\nsistemáticamente con el objetivo de desarrollar conocimiento generalizable. Se\ndefine a seres humanos como personas que que (i) se vuelven identificables\nindividualmente por la recolección, preparación o uso de material biológico o\nrecords médicos o de otro tipo, o (ii) están expuestos a la manipulación,\nintervención, observación u otra interacción con los investigadores\ndirectamente o por medio de la alteración de su entorno.</p>\n\n<p>La investigación\ncon seres humanos incluye estudios que usan tejidos, muestras, datos u otros\nrecords de personas, así como estudios que involucran la conducción de\nentrevistas, grupos focales o encuestas, o la observación del comportamiento\nprivado.</p>\n\n<p>Las actividades\nque no constituyen investigación con seres humanos están exentas de revisión\nética. Estas pueden ser actividades que no buscan la producción de conocimiento\ngeneralizable o no involucran a seres humanos en las maneras descritas. Por\nejemplo, las siguientes actividades no constituyen investigación con seres\nhumanos y están por ello exentas de revisión ética:</p>\n\n<ul><li>Estudios que\nutilizan datos que están disponibles públicamente o son generados por la\nobservación de comportamiento público.</li></ul>\n\n<ul><li>Estudios que\nusan datos, muestras o tejidos ya existentes (previamente obtenido por otros)\nque son recibidos por los investigadores de manera tal que la identidad de los\nindividuos no puede ser establecida.</li></ul>\n\n<ul><li>Actividades de\nsalud pública llevadas a cabo por la autoridad reconocida de salud pública con\nel objetivo de prevenir o controlar una enfermedad o daño, incluidas\nactividades de vigilancia que buscan solo identificar o controlar un problema\nde salud. Estas son actividades que buscan el beneficio de los participantes o\nlas comunidades de los participantes, y no buscan generar conocimiento que es\naplicable a otras poblaciones.</li></ul>\n\n<ul><li>Actividades de\ncontrol de calidad o evaluaciones de programas que buscan mejorar el programa\nen cuestión y sin intención de producir conocimiento generalizable.</li></ul>\n\n<p>Hay proyectos que\npueden tener múltiples componentes, algunos de los cuales pueden constituir\ninvestigación con seres humanos mientras que otros pueden no serlo. El\ncomponente que constituye investigación con seres humanos debe pasar por\nrevisión ética. La determinación de si una propuesta no está exenta de revisión\nética la debe hacer una parte independiente, como un comité de revisión ética.</p>'),(627,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','question','2','¿Qué pautas éticas internacionales gobiernan la investigación con humanos?'),(628,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','answer','2','<ul><li>Declaración de\nHelsinki de la Asociación Médica Mundial (revisión del 2013): <a href=\"http://www.iacs.aragon.es/econocimiento/documentos/ceica/2013-declaracion-helsinki-brasil.pdf\" rel=\"nofollow\" target=\"_blank\">http://www.iacs.aragon.es/econocimiento/documentos/ceica/2013-declaracion-helsinki-brasil.pdf</a>\n</li></ul>\n\n<ul><li>Pautas éticas\ninternacionales para la investigación biomédica en seres humanos del Consejo de\nOrganizaciones Internacionales de las Ciencias Médicas (CIOMS): <a href=\"http://www.cioms.ch/publications/guidelines/pautas_eticas_internacionales.htm\" rel=\"nofollow\" target=\"_blank\">http://www.cioms.ch/publications/guidelines/pautas_eticas_internacionales.htm</a>\n</li></ul>\n\n<ul><li>Pautas\ninternacionales para la evaluación ética de los estudios epidemiológicos del\nCIOMS: <a href=\"http://www.ms.gba.gov.ar/sitios/ccis/files/2012/08/PAUTASINTERNACIONALESEVALUACIONETICAESTUDIOSEPIDEMIOLOGICOS1991.pdf\" rel=\"nofollow\" target=\"_blank\">http://www.ms.gba.gov.ar/sitios/ccis/files/2012/08/PAUTASINTERNACIONALESEVALUACIONETICAESTUDIOSEPIDEMIOLOGICOS1991.pdf</a>\n</li></ul>'),(629,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','question','3','¿Cuáles son los estándares de cada país para la investigación con seres humanos?'),(630,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','answer','3','<ul><li>Compilación\ninternacional de estándares para la investigación con seres humanos (edición\ndel 2015): <a href=\"http://www.hhs.gov/ohrp/international/index.html\" rel=\"nofollow\" target=\"_blank\">http://www.hhs.gov/ohrp/international/index.html</a></li></ul>'),(631,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','question','4','¿Cómo debe funcionar un comité de revisión ética de la investigación con seres humanos?'),(632,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','answer','4','Pautas\ny orientación operativa para la revisión ética de la investigación en salud con\nseres humanos publicadas por OPS/OMS: <a href=\"http://www.paho.org/hq/index.php?option=com_docman&amp;task=doc_view&amp;Itemid=270&amp;gid=22738&amp;lang=es\" rel=\"nofollow\" target=\"_blank\">http://www.paho.org/hq/index.php?option=com_docman&amp;task=doc_view&amp;Itemid=270&amp;gid=22738&amp;lang=es</a> <br>'),(633,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','question','5','¿Qué preguntas deben guiar la revisión ética de la investigación con seres humanos?'),(634,'es_ES','Proethos2\\ModelBundle\\Entity\\Faq','answer','5','<ul><li>Valor social:\n¿Puede el estudio llevar a mejoras en la salud o el bienestar? ¿Cuál es el\nvalor potencial de la investigación para cada uno de los posibles\nbeneficiarios?</li></ul><ul><li>Validez\ncientífica: ¿Es la investigación metodológicamente válida y científica (y\nestadísticamente) sólida? ¿Va el estudio a generar datos válidos y confiables\nque puedan ser generalizables? ¿Es viable? ¿Permite el diseño del estudio dar a\nlos participantes aquellos servicios de salud que les corresponden? Si no es el\ncaso, ¿hay razones metodológicas poderosas para no hacerlo y se protege a los\nparticipantes de daños serios?</li></ul>\n\n<ul><li>Selección justa\nde participantes: ¿Cuáles son los criterios para incluir y excluir participantes?\n¿Se basa la selección en criterios científicos? ¿Se selecciona a participantes\nde manera que se minimicen los riesgos y se maximicen los beneficios\npotenciales? Si los participantes son vulnerables, ¿hay salvaguardas para\nprotegerlos? ¿Se distribuyen los riesgos y potenciales beneficios del estudio\nde manera equitativa?</li></ul>\n\n<ul><li>Balance favorable\nde riesgos y beneficios: ¿Pueden minimizarse los riesgos para los\nparticipantes? ¿Pueden mejorarse los beneficios potenciales para los individuos\ny la sociedad? ¿Son los beneficios potenciales para la sociedad y los\nindividuos superiores a los riesgos?</li></ul>\n\n<ul><li>Consentimiento\ninformado: ¿Se da a los potenciales participantes la información acertada,\nclara, relevante y completa? ¿Son los procedimientos de reclutamiento, el proceso\nde consentimiento y los incentivos apropiados para la cultura y el contexto?\n¿Hay un plan apropiado para obtener la autorización de quienes no pueden\nconsentir por si mismos? ¿Se aclara a los participantes que tienen derecho a no\nparticipar? ¿Son libres de no participar?</li></ul>\n\n<ul><li>Respeto por los\nparticipantes: ¿Cómo se va a monitorear la salud y el bienestar de los\nparticipantes para minimizar daños? ¿Cómo se va a proteger su privacidad?\n¿Pueden retirarse del estudio sin represalias? ¿Cuáles son los planes de atención\nluego de terminado el estudio? ¿Se les va a dar a los participantes cualquier\nnueva información (incluidos los resultados del estudio)?</li></ul>\n\n<p>(Adaptado de (1) Emanuel E, Wendler D, Grady C. An ethical\nframework for biomedical research. In: Emanuel E et al. eds. The Oxford\ntextbook of clinical research ethics. New York, NY: Oxford University Press;\n2008: 123-135. (2) Emanuel E, Wendler D, Grady C. What makes clinical research\nethical? JAMA 2000;283:2701-27711. (3) Emanuel E, Wendler D, Killen J, Grady C.\nWhat makes clinical research in developing countries ethical? The benchmarks of\nethical research. JID 2004;189:930-937.)</p>\n\n<br><br><br><br>'),(635,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','1','Breve resumo do protocolo '),(636,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','2','Palavras-chave referentes ao protocolo, separado por vírgulas'),(637,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','3','Informações de introdução do protocolo '),(638,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','4','Justificação do estudo '),(639,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','5','Objetivos do estudo '),(640,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','13','E esta apresentação de um ensaio clínico? '),(641,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','14','Título científico do protocolo'),(642,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','15','Título público do protocolo'),(643,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','16','Este protocolo tem um acrônimo?'),(644,'pt_BR','Proethos2\\ModelBundle\\Entity\\Help','message','56','Pesquisar por