:21:20','2016-09-01 13:21:20',1,'help','Submission Language'),(199,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'help','Does my project need ethics review?'),(200,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Dear investigator,\r\n\r\nCMHS REC has accepted this monitoring action as a notification. It will not be reviewed by the committee.\r\n\r\nProtocol <b>%protocol_code%</b>: %protocol_url%\r\n\r\nRegards,\r\nCMHS REC'),(201,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Hello!\r\n\r\nA new monitoring action has been submitted.\r\n\r\nAccess the link below for more details.\r\n\r\nProtocol <b>%protocol_code%</b>: %protocol_url%\r\n\r\nRegards,\r\nCMHS REC'),(202,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Dear investigator,\r\n\r\nYour protocol was sent to ethics review.\r\nThe committee will now meet to review your protocol, and an official decision will be sent to you shortly.\r\n\r\nAccess the link below for more details:\r\n\r\n%protocol_url%\r\n\r\nRegards,\r\nCMHS REC'),(203,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Hello!\r\n\r\nYou have been registered in the CMHS REC platform.\r\n\r\nPlease access the link below and set your password:\r\n\r\n%reset_password_url%\r\n\r\nRegards,\r\nCMHS REC'),(204,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Hello!\r\n\r\nYour access has been validated in the CMHS REC platform.\r\n\r\nAccess the link below:\r\n\r\n%home_url%\r\n\r\nRegards,\r\nCMHS RECC'),(205,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Hello!\r\n\r\nA message was sent to CMHS REC administrator from platform.\r\n\r\n<b>User</b>: %username% (%email%)\r\n<b>Subject</b>: %subject%\r\n<b>Message</b>:\r\n%message%\r\n\r\nRegards,\r\nCMHS REC'),(206,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Hello!\r\n\r\nYou asked for a new password in CMHS REC platform.\r\n\r\nPlease access the link below to change your password:\r\n\r\n%reset_password_url%\r\n\r\nRegards,\r\nCMHS REC'),(207,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Hello!\r\n\r\nYou have been registered in the CMHS REC platform.\r\nPlease wait until your access has been validated.\r\nWe will send you an email.\r\n\r\nRegards,\r\nCMHS REC'),(208,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Hello!\r\n\r\nThere is a new user registered in the CMHS REC platform.\r\n\r\nPlease check and authorize this access.\r\n\r\n%home_url%\r\n\r\nRegards,\r\nCMHS REC'),(209,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Hello!\r\n\r\nYour protocol was rejected.\r\n\r\nAccess the link below for more details.\r\n\r\n%protocol_url%\r\n\r\nRegards,\r\nCMHS REC'),(210,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Hello! A new protocol needs your analysis.\r\n\r\nAccess the link below for more details.\r\n\r\nProtocol <b>%protocol_code%</b>: %protocol_url%\r\n\r\nRegards,\r\nCMHS REC'),(211,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Hello!\r\n\r\nYour protocol was sent to review.\r\n\r\nAccess the link below.\r\n\r\nProtocol <b>%protocol_code%</b>: %protocol_url%\r\n\r\nRegards,\r\nCMHS REC'),(212,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Dear investigator,\r\n\r\nCMHS REC conducted an initial review of your research proposal and determined it must pass through full ethics review before initiating the research.\r\nCMHS REC meets on the second Tuesday of each month to review complete proposals.\r\nCMHS REC observations are emailed to research teams shortly after each monthly meeting.\r\n\r\nInitial committee screening: %committee_screening%\r\n\r\nAccess the link below for more details.\r\n\r\nProtocol <b>%protocol_code%</b>: %protocol_url%\r\n\r\nRegards,\r\nCMHS REC'),(213,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Dear investigator,\r\n\r\nCMHS REC conducted an initial review of your research proposal and determined it must pass through full ethics review before initiating the research.\r\nCMHS REC meets on the second Tuesday of each month to review complete proposals.\r\nCMHS REC Observations are emailed to research teams shortly after each monthly meeting.\r\n\r\nAccess the link below for more details.\r\n\r\nProtocol <b>%protocol_code%</b>: %protocol_url%\r\n\r\nRegards,\r\nCMHS REC'),(214,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Dear investigator,\r\n\r\nWe write to you in regards to your research proposal, which you recently submitted to CMHS REC for ethics review.\r\nAttached you will find the official decision issued by the Committee for this proposal.\r\nThank you for your submission. We look forward to continue receiving your valuable contributions.\r\n\r\nAccess the link below for more details.\r\n\r\nProtocol <b>%protocol_code%</b>: %protocol_url%\r\n\r\nRegards,\r\nCMHS REC'),(215,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Dear Reviewer,\r\n\r\nWe are writing to inform you that you have been selected to participate in an ethical review of a research study entitled \"%protocol_title%\" submitted to our institution. Your expertise in the relevant field and experience with research ethics make you an ideal candidate for this task.\r\n\r\nBefore we can proceed with the ethical review process, we kindly ask that you complete a declaration of potential conflicts of interest. The declaration form can be accessed via the following link: %protocol_url%\r\n\r\nThank you for your cooperation.\r\n\r\nBest regards,\r\n\r\nCMHS REAMS'),(216,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Dear investigator,\r\n\r\nWe write to you in regards to your research proposal, which you recently submitted to CMHS REC for ethics review.\r\nAttached you will find the official decision issued by the Committee for this proposal.\r\nThank you for your submission. We look forward to continue receiving your valuable contributions.\r\n\r\nAccess the link below for more details.\r\n\r\nProtocol <b>%protocol_code%</b>: %protocol_url%\r\n\r\nRegards,\r\nCMHS REC'),(217,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Hello!\r\n\r\nA new protocol has been submitted.\r\n\r\nAccess the link below for more details.\r\n\r\n%protocol_url%\r\n\r\nRegards,\r\nCMHS REC'),(218,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Hello!\r\n\r\nA new comment has been submitted:\r\n\r\n\"%comment%\"\r\n\r\nAccess the link below for more details:\r\n\r\n%protocol_url%\r\n\r\nRegards,\r\nCMHS REC'),(219,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Hello!\r\n\r\nA new protocol review has been submitted.\r\n\r\nAccess the link below for more details:\r\n\r\nProtocol <b>%protocol_code%</b>: %protocol_url%\r\n\r\nRegards,\r\nCMHS REC'),(220,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'help','Clinical study activity'),(221,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'help','Activity description'),(222,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'help','Budget description'),(223,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Hello!\r\n\r\nThis is to remind you that protocol <b>%protocol_code%</b> has a pending monitoring action that is due on <b>%monitoring_date%</b>.\r\n\r\nPlease access your account in the system to present your monitoring action.\r\n\r\nRegards,\r\nCMHS REC'),(224,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Hello! \n\nThis is email is sent to inform you that the review assigned to the research application entitled \"<b>%research_title%</b>\" cannot be completed due to a conflict of interest that has been declared by the assigned reviewer %name_of_reviewer%. \n\nThe system has been designed to ensure that all reviews are unbiased and impartial, and the identification of a conflict of interest is an important step in maintaining the integrity of the review process. Please assign a new reviewer for this research proposal as soon as possible. Use the following link to assign another reviewer %inital_committee_review_url% \n\nRegards, \n\nCMHS REC'),(225,'2019-02-21 15:42:08','2019-02-21 15:42:08',1,'mail','Hello!\n<br />\nThis is email is sent to inform you that the review assigned to the research application entitled \"<b>%research_title%</b>\" cannot be completed because of the assigned reviewer %name_of_reviewer% declared the Reviewer Assurance Declaration.\n\nTherefore, the system requests that you assign a new reviewer to the protocol as soon as possible. Use the following link to assign another reviewer %inital_committee_review_url%\n\nRegards,\n\nCMHS REC'),(226,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Limitations'),(300,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Study design'),(301,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Research Area and Period'),(302,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Health Condition or Problem Studied'),(303,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Study Subject'),(304,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Source Population'),(305,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Study Population'),(306,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Sample Size Calculations'),(307,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Sampling Techniques'),(308,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Sampling Procedures'),(309,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Dependent Variables'),(310,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Independent Variables'),(311,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Operational Definitions'),(312,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Data Collection Tools'),(313,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Data Collection Procedure'),(314,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Data Quality Assurance'),(315,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Data Management and Analysis'),(316,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','You selected Other study subject, Please specify'),(317,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Inclusion criteria'),(318,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Exclusion  criteria'),(319,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Estimated date of initial recruitment'),(320,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Recruitment Status'),(321,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Interventions'),(322,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Ethical Considerations'),(323,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Limitations'),(401,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Is the account activated'),(402,'2016-06-16 14:11:29','2016-06-16 14:11:29',1,'help','Responsible body for the task');
